import React from 'react';
import {Navigate} from 'react-router-dom';

const Product = ({ title, image, price, color, type, id }) => {

    const goToProduct = (id) => {
        <Navigate to={`/product/:`} />
    }

    return (
        <div className="product-card" onClick={goToProduct(id)}>
            <p>{title}</p>
            <img src={image}/>
        </div>
    );
};

export default Product;
